  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains a list of products
  that carry the Design for the Environment (DfE) label. This mark enables consumers
  to quickly identify and choose products that can help protect the environment and
  are safer for families. When you see the DfE logo on a product it means that the
  DfE scientific review team has screened each ingredient for potential human health
  and environmental effects and that-based on currently available information,  EPA
  predictive models,  and expert judgment-the product contains only those ingredients
  that pose the least concern among chemicals in their class. Product manufacturers
  who become DfE partners,  and earn the right to display the DfE logo on recognized
  products,  have invested heavily in research,  development and reformulation to
  ensure that their ingredients and finished product line up on the green end of the
  health and environmental spectrum while maintaining or improving product performance.
  EPA's Design for the Environment Program (DfE) has allowed use of their logo on
  over 2500 products. These products are formulated from the safest possible ingredients
  and have reduced the use of \"chemicals of concern\" by hundreds of millions of
  pounds.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
